import React from "react";
import { useNavigate } from "react-router-dom";

export default function ProtectedRoute({ children }) {
  const navegate = useNavigate();
  if (localStorage.getItem("tkn") === null) {
    return <navigator/>
  }

  return <>{children}</>;
}
